import "./App.css";
import "./index.css";
import Movies from "./Movies";
import Show from "./Show";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="App">
        <Route path="/Movies" component={Movies} />
      </div>
    </Router>
  );
}

export default App;
